Information
------------------------------

Nelson Mandela: The Final Chapter
To commemorate the passing of Nelson Mandela, SBS presents Nelson Mandela: The Final Chapter, a fresh portrait of the anti-apartheid hero, never-before screened in Australia.
Nelson Mandela remembered.
Directed by award-winning filmmaker Clifford Bestall, this film offers a unique glimpse into the life of Nelson Mandela at a point when, in his own words, he 'retired from retirement'.
The filmmakers were given unprecedented access to Mandela from the beginning of his 90th year until his final retreat from public life. The resulting documentary is an intimate portrayal of one of history's most respected and revered statesmen.
Nelson Mandela - The Final Chapter includes never-before seen footage of Mandela's last ever tour abroad, as well as private meetings and discussions with admirers, celebrities, heads-of-state and ordinary people. It is a privileged insight into his time in retirement, the final chapter in a remarkable life.

